import React from "react";
import {DefaultSection,SectionTitle } from "../section";
import styled from "styled-components";
const SloganButton = styled("button")`

  height: 34px;
  background: #A02167;
  box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.25);
  border-radius: 5px;
  margin: 30px 0px;
  font-style: normal;
  font-weight: bold;
  font-size: 14px;
  line-height: 19px;
  text-align: center;
  color: #ffffff;
  border-color: transparent;
  vertical-align: middle;
`;
const CustomSectionTitle = styled(SectionTitle)`
font-family: Open Sans;
font-style: normal;
font-weight: 600;
font-size: 32px;
line-height: 44px;
`;

const SignUp = () => {
  return (
    <>
    <DefaultSection>
      <CustomSectionTitle>What are you waiting for? Start today.</CustomSectionTitle>
      <SloganButton>Get Started</SloganButton>

      </DefaultSection>
    </>
  );
};

export default SignUp;
